mongo aggregation adding dates and sums<p>I feel like this could be really complex. I know this is possible in JS by taking each record, determine the difference in months, then increase each model.month by 1 within a for loop that stops once the months difference has been met. I just can't wrap my head around the possibility with aggregation. Any help would be a lifesaver!</p>

<p>Here is my data:</p>

<pre><code>{
   model: car
   serial: bbbaaa
   warranty_start_date: 03/05/2018
   warranty_end_date: 06/16/2018
},
{
   model: car
   serial: jjjwww
   warranty_start_date: 03/02/2018
   warranty_end_date: 05/20/2018
},
{
   model: truck
   serial: tttvvv
   warranty_start_date: 05/06/2016
   warranty_end_date: 07/15/2016
}
</code></pre>

<p>This is how I want it to end up:</p>

<pre><code>{
  model: car
  in_warranty_these_months: { 03/2018: 2, 04/2018: 2, 05/2018: 2, 06/2018: 1 } 
},
{
  model: truck
  in_warranty_these_months: { 05/2016: 1, 06/2016: 1, 07/2016: 1 } 
}
</code></pre>

<p><b>UPDATE</b>
with major help from @mickl,
the below code works like a charm:</p>

<pre><code> db.col.aggregate([
    {
        $addFields: {
            monthsRange: {
                $range: [ 
                    { $add: [ 
                        { $multiply: [12, {$year: "$warranty_start_date"}] }, 
                        {$month: "$warranty_start_date"} ] 
                    }, 
                    { $add: [ 
                        { $multiply: [12, {$year: "$warranty_end_date"}] }, 
                        { $add: [{$month: "$warranty_end_date"}, 1] } ] 
                    }, 1]
            }
        }
    },
    {
        $unwind: "$monthsRange"
    },
    {
        $group: {
            _id: { model: "$model", month: "$monthsRange" },
            count: {$sum:1}
        }
    },
    {
      $group: {
        _id: "$_id.model",
        pairs: {
          $push: {          
            k: {
              $dateToString: {
                format: "%m_%Y",
                date: {
                  $dateFromParts: {
                    day: 1,
                    month: {
                      $cond: [{
                        $eq: [0, {
                          $mod: ["$_id.month", 12]
                        }]
                      }, {
                        $trunc: 12
                      }, {
                        $mod: ["$_id.month", 12]
                      }]
                    },
                    year: {
                      $cond: [{
                        $eq: [0, {
                          $mod: ["$_id.month", 12]
                        }]
                      }, {
                        $subtract: [{
                          $trunc: {
                            $divide: ["$_id.month", 12]
                          }
                        }, 1]
                      }, {
                        $trunc: {
                          $divide: ["$_id.month", 12]
                        }
                      }]
                    }
                  }
                }
              }
            },
            v: "$count"
          }
        }
      }
    },
    {
            $project: {
                _id: 0,
                model: "$_id",
                in_warranty_these_months: {
                    $arrayToObject: "$pairs"
                }
            }
        }
    ])
</code></pre>

