<p>I am then using <code>$project</code> to shape how that data displays.</p>

<p>This is what my initial <code>$project</code> looks like, and this is stage 1 of my pipeline:</p>

<pre><code>{ "name" : 1.0, "dob" : 1.0, "coverage" : 1.0, "payer" : 1.0 }
</code></pre>

<p>For stage 2, I'm doing my <code>$lookup</code>, which looks like this:</p>

<pre><code>{ "from" : "payers", "localField" : "coverage.payer", "foreignField" : "_id", "as" : "payerInfo" }
</code></pre>

<p>Finally I'm shaping how the data looks with a step like this:</p>

<pre><code>"coverage" : { "payer" : { "id" : "$payerInfo._id", "name" : "$payerInfo.name" }
</code></pre>

<p>The problem I'm running into is that, if for instance, "coverage" -- which is from the primary collection - has more than one object in the array, then the same "payer" info -- which is from the secondary collection -- is being dropped in for <em>each</em> of those. So basically the indexing is off. There should be a different payerId and payerName for each object in the coverage array.</p>

<p>What operation can I run to ensure that the correctly corresponding payer info (pulled from the second collection via the $lookup), gets dropped into the appropriate object within the "coverage" array? </p>

<p>Below is what the outputted data looks like (and, as I say, this is incorrect. Right now the same payer info is being added to both objects in the "coverage" array, when those should be different).</p>

<pre><code>    "coverage": [
        {
            "payer": {
                "id": [
                    "12345"
                ],
                "name": [
                    {
                        "long": "National United",
                        "short": "NU"
                    }
