  if(req.isAuthenticated()) {
    return next();
  }

  res.redirect('/users/login');
}
function isAdmin(req, res, next) {
  var user = req.user;
  if(user.isAdmin == true) {
    return next();
  } 
  res.redirect('/users/profile');
}

function notLoggedIn(req, res, next) {
  if(!req.isAuthenticated()) {
    return next();
  }
  res.redirect('/');
}

module.exports = router;
